public class MinimumWindowSubstring {
    public static String minWindow(String s, String t) {
        int[] cnt = new int[256];
        int[] cnt_copy = new int[256];
        for(int i = 0; i < t.length(); i++) {
            cnt[t.charAt(i)]++;
            cnt_copy[t.charAt(i)]++;
        }
        int left = 0; int right = 0;
        int result = Integer.MAX_VALUE;
        int start = 0; int end = 0;
        int count = t.length();
        while(left < s.length()) {
            boolean marked = (count == 0);
            right = Math.min(right, left);
            while(!marked && right <s.length()) {
                if (cnt[s.charAt(right)] > 0) {
                    cnt[s.charAt(right)] -= 1;
                    count--;
                }
                right++;
                marked = (count == 0);
            }
            if(marked) {
                if(result > right - left) {
                    result = right - left;
                    start = left;
                    end = right;
                }
            }
            count = t.length();
            for(int i = 0; i < t.length(); i++)
                cnt[t.charAt(i)] = cnt_copy[t.charAt(i)];
            left++;
        }
        return s.substring(start, end);
    }

    public static void main(String[] args) {
        String s = "";
        String t = "";
     // String s = "bbbbbbbbbbbbbbbbbbbbbaavd";
     // String t = "avd";
        System.out.println(MinimumWindowSubstring.minWindow(s, t));
    }
}
